<html>
	<head>
		<title>Self - modifying HTML</title>
		<script>
		function appendp() {
			var h1_node = document.createElement ("h1");
			h1_node.innerHTML = "Self - modifying HTML Document";
			document.childNodes[0].childNodes[2].appendChild ( h1_node );
			
			var p_node = document.createElement("p");
			p_node.innerHTML = " This web page illustrates how DOM API can be used to modify a web page";
			document.childNodes[0].childNodes[2].appendChild ( p_node );
		}

		function gethtmlchildren() {
			var entiredoc = document.childNodes[0];
			var docnodes = entiredoc.childNodes;
			for(i=0; i<docnodes.length ; i++)
				alert(docnodes[i].nodeName);
		}
		
		//Depth-first-search DOM traversal algorithm.
		function makeDOMTree(){
			//specify a data structure with a node (nd) and the rank (rk)
			//the rank is used for formatting
			var node = { nd: document.firstChild, rk:1 }; 
			var tree = "";	//the output
			
			//begin traversing through the node
			while (node){
				//print out only the HTML tag of the node, along with formatting based on the rank
				if (node.nd.tagName){
					for (var i = 0 ; i < node.rk ; i++) tree+="--- |";
					tree += node.nd.tagName+"<br/>";
				}
				
				//traverse to the first child of the current node, increasing the rank
				if (node.nd.firstChild){
					node = { nd: node.nd.firstChild, rk: node.rk+1 }
				//traverse to its neighbor
				} else if (node.nd.nextSibling) {
					node = { nd: node.nd.nextSibling,rk: node.rk };
				//traverse back to its parent if it meets a last, child-less node, decreasing the rank
				//until you found a parent which has sibling nodes
				} else {
					do{
						node = { nd: node.nd.parentNode, rk: node.rk-1 }
						//if it traverses back to the root, the traversal function ends and
						//we coudl print the output
						if (node.nd == document.firstChild) {
							document.write(tree);
							return;
						}
					} while (!node.nd.nextSibling
					//traverse to the next sibling of the parent
					node.nd = node.nd.nextSibling;
				}
			}
		}

		</script>
	</head>
	<body name ="bodybody">
		<h1 >SOP Lab </h1 >
		<script> appendp();</script>
		<input type =" button" value ="Display children of HTML tag" onclick = gethtmlchildren()>
		
		<p><script>makeDOMTree()</script></p>
	</body>
